import './UserSelection.css';
import { Link } from 'react-router-dom'

function UserSelection() {
    return (
        <div>
            <h2>Selection du profil</h2>
            <nav>
                <Link className='main-nav' to="/">Karl</Link>
                <Link className='main-nav' to="/profil">Cecilia</Link>
                <Link className='main-nav' to="/reglage">Réglages</Link>
                <Link className='main-nav' to="/communaute">Communauté</Link>
            </nav>
        </div>

    );
}

export default UserSelection;
